import React from 'react';
import './Analysis.css';
import Chart from './Chart';
import LineChart from './Line-Chart';


function Analysis() {

  return (
    <div id="Analysis">
      <div className='background'>
        <Chart /> <LineChart />
      </div>
      <div className='background'>
        <Chart /> <LineChart />
      </div>
    </div>
  );
}

export default Analysis;
